  false,\n\t\"url\": null,\n\t\"notes\": \"Observer data span more than two decades
  and multiple database development interations.  To facilitate status of stocks authors
  and other users of these records, a data set separate from the OLAP was created
  which reformats and repackages vetted (debriefed) observer data from NORPAC into
  a common structure, format, and syntax.  The granularity of current production data
  is compromised, however for the purposes of longitudinal research the data set is
  internally consistant, and spans the developmental boundaries.\",\n\t\"owner_org\":
